window.bookSummaryJSON = "<p><b>In the sequel to </b><b><i>Pilot X</i></b><b>, our favorite time traveler returns to save the universe once again in this mind-bending space adventure. </b></p> <p>Pilot X is riddled with guilt. After facing the impossible decision to eliminate his own people or save the universe, he is the lone survivor of a time-traveling race.&nbsp;</p> <p>But Pilot X soon finds that he’s got more than his own guilt to contend with. His timeship <i>Verity </i>detects a signal that someone is working to recreate the dangerous technology that threatened the universe in the first place. Pilot X now sets off to save a universe he no longer recognizes, but feels frighteningly familiar.</p>"; 
